import React from 'react'

const Header = (props) => {
  return (
    <div>
      <h1>{props.course}</h1>
    </div>
  )
}

const Content = (props) => {
  return (
    <div>
      <Part1><p>{props.name} {props.exercises}</p></Part1>
      <Part2><p>{props.name} {props.exercises}</p></Part2>
      <Part3><p>{props.name} {props.exercises}</p></Part3>
    </div>
  )
}

const Total = () => {
  return (
      <p>Number of exercises</p>
  )
}

const App = () => {
  const course = 'Half Stack application development'
  const part1 = {
    name: 'Fundamentals of React',
    exercises: 10
  }
  const part2 = {
    name: 'Using props to pass data',
    exercises: 7
  }
  const part3 = {
    name: 'State of a component',
    exercises: 14
  }

  return (
    <div>
      <Header course={course} />
      <Content />
      <Total  />
    </div>
  )
}

export default App
